export const actionTypes = {
    GET_ALL_EXAMPACKAGE_REQUEST: 'GET_ALL_EXAMPACKAGE_REQUEST',
    GET_ALL_EXAMPACKAGE_SUCCESS: 'GET_ALL_EXAMPACKAGE_SUCCESS',
    GET_INACTIVE_EXAMPACKAGE_REQUEST: 'GET_INACTIVE_EXAMPACKAGE_REQUEST',
    GET_INACTIVE_EXAMPACKAGE_SUCCESS: 'GET_INACTIVE_EXAMPACKAGE_SUCCESS'
};

export function getAllAnnouncements(payload) {
    return { type: actionTypes.GET_ALL_EXAMPACKAGE_REQUEST, payload };
}

export function getAllAnnouncementsSuccess(payload) {
    return { type: actionTypes.GET_ALL_EXAMPACKAGE_SUCCESS, payload };
}

export function getInactiveAnnouncements(payload) {
    return { type: actionTypes.GET_INACTIVE_EXAMPACKAGE_REQUEST, payload };
}

export function getInactiveAnnouncementsSuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_EXAMPACKAGE_SUCCESS, payload };
}
